style.css:
@-moz-document domain("www.myaccountcenter.com") {
/* Mark and number Code your Own modules */

ul#steBuilderWebpageModules li[data-controller-name="CodeYourOwn"] {
    border-left: 20px solid #444;
    position:relative;
}


ul#steBuilderWebpageModules li[data-controller-name="CodeYourOwn"]::before {
    content: counter(item) " ";
    counter-increment: item;
    position:absolute;
    color:#fff;
    left:-14px;
    height:100%;
    top:40%;
    z-index:20000;
}

ul#steBuilderWebpageModules {
      counter-reset: item;
}
}
